// JumpIt! by Frank Force
// A = Jump / B = Restart

let distance, playing, ground, Y, V, W;

const reset = ()=>
{
    Y = 0;
    W = 22;
    distance = V = 0;
    playing = 1;
}

feature.on('start', e=> 
{
    reset();
});

feature.on('frame', e=> 
{
    clearScreen();
    playing && ++distance;

    // draw ground
    for (let i=5; i--;)
    {
        const j = i+distance/W|0;
        setDrawColorHSLA(j/29);
        const g = 47-Math.cos(j*j)*15|0;
        drawRectOutline(j*W-distance-7, g, W-3, 1e4);
        i && (ground=g);
    }

    // sub step physics
    for (let i=2; i--;)
    {
        Y -= V -= .06;
        if (Y > ground)
        {
            // check for safe landing
            V = 0;
            Y < ground+3 ? Y = ground : playing = 0;
        }
    }

    // draw player
    setDrawColorHSLA(distance/50, 1, .7);
    drawRect(9, Y-9, 6, 9);

    // draw score
    setDrawColorHSLA(0, 0, 1);
    drawNumber(distance/W|0, 24, 0);
});

feature.on('keys', e=>
{
    // jump
    if (e.keys.a)
        Y-ground || (V=2);
    if (e.keys.b)
        reset();
});

