// vidscreen helper functions by frank force

const clamp       = (v, max=1, min=0)=> v < min ? min : v > max ? max : v;
const percent     = (v, a, b)=>         b-a ? clamp((v-a) / (b-a)) : 0;
const lerp        = (p, a, b)=>         a + clamp(p) * (b-a);
const clearScreen = (v=0)=>             feature.screen.fill(v);
const seededRand  = (seed, max=1)=>     Math.sin(seed)**2 * 1e9 % 1 * max;

let drawColor = [255, 255, 255, 1];
const setDrawColorRGBA = (r=0, g=0, b=0, a=1)=> drawColor = [r, g, b, a];
const setDrawColorHSLA = (h=0, s=1, l=.5, a=1)=>
{
    let r, g, b;
    if (s)
    {
        const f = (p, q, t)=>
        {
            t = ((t%1)+1)%1;
            return t < 1/6 ? p+(q-p)*6*t :
                t < 1/2 ? q :
                t < 2/3 ? p+(q-p)*(2/3-t)*6 : 
                p;
        }

        const q = l < .5 ? l*(1+s) : l+s-l*s, p = 2*l-q;
        r = f(p, q, h + 1/3);
        g = f(p, q, h);
        b = f(p, q, h - 1/3);
    }
    else
        r = g = b = l;

    setDrawColorRGBA(r*255, g*255, b*255, a);
}

const drawPixel = (x, y)=>
{
    const a = drawColor[3];
    if (a <= 0 || x < 0 || x >= feature.screenWidth || y < 0 || y >= feature.screenHeight)
        return;

    const i = 3*((x|0) + (y|0)*feature.screenWidth);
    if (a == 1)
    {
        feature.screen[i+0] = drawColor[0]|0;
        feature.screen[i+1] = drawColor[1]|0;
        feature.screen[i+2] = drawColor[2]|0;
        return;
    }

    // draw pixel with alpha
    const r = feature.screen[i+0] || 0;
    const g = feature.screen[i+1] || 0;
    const b = feature.screen[i+2] || 0;
    feature.screen[i+0] = lerp(a, r, drawColor[0], 255)|0;
    feature.screen[i+1] = lerp(a, g, drawColor[1], 255)|0;
    feature.screen[i+2] = lerp(a, b, drawColor[2], 255)|0;
}

const drawRect = (x, y, w, h)=>
{
    for (let i = x; i < x + w; ++i)
    for (let j = y; j < y + h; ++j)
        drawPixel(i,j);
}

const drawRectOutline = (x, y, w, h)=>
{
    for (let i = x; i < x + w; ++i)
        drawPixel(i,y), drawPixel(i,y+h-1);
    for (let i = y; i < y + h; ++i)
        drawPixel(x,i), drawPixel(x+w-1,i);
}

const drawNumber = (n,x,y)=>
{
    n = (n|0)+'';
    for (const j of n)
    {
        for (let i=7;i--;)
            '{O<7w?'.charCodeAt(j)&2**i&&drawRect(i>4|i<3?x:x+5,y+(i%2?1:i?5:9)-1,i>2?2:7,i>2?5:1);
        x += 9;
    }
}

let ball, paddle, frame, blocks

feature.on('keys', e => {
  if (e.keys.left) {
    paddle.moveLeft()
  } else if (e.keys.right) {
    paddle.moveRight()
  }
})

feature.on('start', e => {
  reset()
})

feature.on('frame', em=> {
  frame += 1
  update()
  draw()
})

function update() {
  ball.update()
}

function draw() {
  feature.screen.fill(0)

  ball.draw()
  paddle.draw()
  for (j = 0; j < blocks.length; j ++) {
    blocks[j].draw()
  }
}

function reset() {
  ball = new Ball(Math.round(Math.random() * 64), 32)
  paddle = new Paddle(29, 60, 6)
  frame = 0
  blocks = []
  for (y = 0; y < 5; y ++) {
    for (z = 0; z < 8; z ++) {
      blocks.push(new Block(Math.floor(feature.screenWidth / 8 * z + 2), y * 4 + 2, 5, 3))
    }
  }
  draw()
}

// classes

class Ball {
  constructor(x, y) {
    this.xPos = x
    this.yPos = y

    this.xVel = Math.random() > 0.5 ? 1 : -1
    this.yVel = 1
  }

  update() {
    if (frame % 2 != 0) {
      return
    }

    // wall collision detection

    if (this.xPos + this.xVel > 63 || this.xPos + this.xVel < 0) {
      this.xVel *= -1
    }
    if (this.yPos + this.yVel < 0) {
      this.yVel *= -1
    }
    if (this.yPos + this.yVel > 63) {
      reset()
    }

    // paddle collision detection

    if ((this.yPos + this.yVel == paddle.yPos)) {
      let nextX = this.xPos + this.xVel
      if (nextX >= paddle.xPos && nextX <= paddle.xPos + paddle.width) {
        this.yVel *= -1
      }
    }

    // block collision detection

    for (let i = 0; i < blocks.length; i ++) {
      let block = blocks[i]
      let nextX = this.xPos + this.xVel
      let nextY = this.yPos + this.yVel

      if (nextX >= block.x && nextX < block.x + block.width && nextY >= block.y && nextY < block.y + block.height) {
        if (this.xPos < block.x || this.xPos > block.x + block.width - 1) {
          this.xVel *= -1
        }
        if (this.yPos < block.y || this.yPos > block.y + block.height - 1) {
          this.yVel *= -1
        }

        blocks.splice(i, 1)
        break
      }
    }

    // update position

    this.xPos += this.xVel
    this.yPos += this.yVel
  }

  draw() {
    for (let i = 0; i < 3; i ++) {
      feature.screen[this.yPos * feature.screenWidth * 3 + this.xPos * 3 + i] = 255
    }
  }
}

class Paddle {
  constructor(x, y, w) {
    this.xPos = x
    this.yPos = y
    this.width = w
  }

  draw() {
    for (let i = this.yPos * feature.screenWidth * 3 + this.xPos * 3; i < this.yPos * feature.screenWidth * 3 + (this.xPos + this.width) * 3 + 3; i ++) {
      feature.screen[i] = 255
    }
  }

  moveLeft() {
    if (this.xPos > 0) {
      this.xPos -= 1
      draw()
    }
  }

  moveRight() {
    if (this.xPos + this.width < 63) {
      this.xPos += 1
      draw()
    }
  }
}

class Block {
  constructor(x, y, w, h) {
    this.x = x
    this.y = y
    this.width = w
    this.height = h
  }

  draw() {
    // horizontal lines
    for (let i = 0; i < this.width; i++) {
      feature.screen[this.y * feature.screenWidth * 3 + (this.x + i) * 3] = 255
      feature.screen[(this.y + this.height - 1) * feature.screenWidth * 3 + (this.x + i) * 3] = 255
    }

    // vertical lines
    for (let i = 0; i < this.height; i++) {
      feature.screen[(this.y + i) * feature.screenWidth * 3 + this.x * 3] = 255
      feature.screen[(this.y + i) * feature.screenWidth * 3 + (this.x + this.width - 1) * 3] = 255
    }
  }
}

const rotation= feature.get('rotation')

let open = false

feature.on('click',e=>{
  if(open){  
    let y = rotation[1]+3.14/2
    feature.set({rotation:[rotation[0],y,rotation[2]]})    
  }else{
    feature.set({rotation:rotation})
  }
  open = !open
})

